import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import {BrowserRouter} from "react-router-dom";
import Navbar from './components/Navbar';

ReactDOM.render(
    <BrowserRouter>
    <Navbar></Navbar>
    <App />
    </BrowserRouter>

, document.getElementById('root'));
